.mdl-spinner__circle {
  box-sizing: border-box;
  height: 100%;
  border-width: $spinner-stroke-width;
  border-style: solid;
  border-color: inherit;
  border-bottom-color: transparent !important;
  border-radius: 50%;
  animation: none;

